import styled from 'styled-components';

const StyledIcon = (WrappedComponent) => {
  const hocComponent = ({ ...props }) => <StyledWrappedComponent {...props} />;

  const StyledWrappedComponent = styled(WrappedComponent)`
    height: 30px;
    width: 30px;
    fill: var(--color-text);
  `;
  return hocComponent;
};

export default StyledIcon;
